import React, { FC } from "react";
// import './styles/dashboard.css';
import { lostSectorType } from "../typeDefinitions/lostSectors";

type MyState = {
    apiResponse: lostSectorType; // like this
  };

class LostSectorRotation extends React.Component<MyState> {
    constructor(props: string) {
        super(props);
        this.state = { apiResponse: "" };
    }
    
    getLostSectors() {
        fetch("http://localhost:9000/api/lost_sector")
            .then(res => res.text())
            .then(res => this.setState({ apiResponse: res }));
    }
    
    componentWillMount() {
        this.getLostSectors();
    }

	render() {
		return <div>{this.state.apiResponse}</div>;
	}
}

export default LostSectorRotation;
